import React from "react";
import { TouchableOpacity, Text } from "react-native";
import { StackNavigationProp } from "@react-navigation/stack";
import RootStackParams from "../../models/RootStackParams"

type EditorButtonProps = {
    navigation: StackNavigationProp<RootStackParams, "Editor"> | undefined;
    documentId?: string;
};

const EditorButton: React.FC<FavoriteButtonProps> = ({ navigation, documentId }) => {
    const onPressHandler = () => {
      if (documentId) {
        navigation?.navigate("Editor", { documentId });
      } else {
        navigation?.navigate("Editor");
      }
    };

   return (
    <TouchableOpacity onPress={onPressHandler}>
      <Text>Go to Favorite</Text>
    </TouchableOpacity>
  );
};

export default EditorButton;
